import React from 'react'
import { Button, withTheme } from '@material-ui/core'
import { Link } from 'react-router-dom'

function AppLink(props) {
    const [color, setColor] = useState(props.theme.palette.primary.main);
    return (
        <>
            <Link {...props}
                component={<Button
                    style={{ color: color }}
                    onMouseOver={() => {
                        setColor(props.theme.palette.secondary.main);
                    }}
                    onMouseLeave={() => {
                        setColor(props.theme.palette.primary.main);
                    }} />}
            />
        </>
    )
}

export default withTheme(AppLink)
